package Week2.day3;

public class Ex_for {
	//정사각형 별 찍기
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i=0; i<5; i++) {	// 행 5개 생성
			for (int j=0; j<5; j++) {	// 열 5개 생성
				System.out.print("*");	//*출력
			}
			System.out.println();	//줄바꿈
		}
	}
}
